import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css'; // This is optional if you have custom styles
import App from './App'; // Import the main App component
import { BrowserRouter as Router } from 'react-router-dom'; // For routing

// Create the root element where the React app will be mounted
const root = ReactDOM.createRoot(document.getElementById('root'));

// Render the App inside the root element, wrapped with Router for routing functionality
root.render(
  <Router>
    <App />
  </Router>
);
